Please fill in this template.

- [x] Make your PR against the `master` branch.
- [x] Use a meaningful title for the pull request. Include the name of the package modified.
- [x] Test the change in your own code. (Compile and run.)
- [x] Follow the advice from the [readme](https://github.com/DefinitelyTyped/DefinitelyTyped/blob/master/README.md#make-a-pull-request).
- [x] Avoid [common mistakes](https://github.com/DefinitelyTyped/DefinitelyTyped/blob/master/README.md#common-mistakes).
- [x] Run `tsc` without errors.
- [x] Run `npm run lint package-name` if a `tslint.json` is present.

Select one of these and delete the others:

If changing an existing definition:
- [ ] Provide a URL to documentation or source code which provides context for the suggested changes: <<url here>>
- [ ] Increase the version number in the header if appropriate.
- [ ] If you are making substantial changes, consider adding a `tslint.json` containing `{ "extends": "../tslint.json" }`.

Return any since it's not possible to infer state from ReactElement. Use case
```tsx
let wrapper: ShallowWrapper<Props, State>;

it("first", () => {
  wrapper = shallow(<MyComponent />);
});

it("second", () => {
  wrapper = shallow(<MyComponent />);
});

```
without this change, it's required to pass template types explicitly to all shallow/mount calls.

Added missing pad method to Rectangle:
pad(top: number, left: number, bottom: number, right: number): Rectangle;

As described here: http://www.createjs.com/docs/easeljs/files/easeljs_geom_Rectangle.js.html
